-- sample data is for events between 2024-10 to 2025-01
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "events" (
	"id"	INTEGER,
	"title"	TEXT NOT NULL,
	"description"	TEXT DEFAULT NULL,
	"color"	TEXT,
	"created_at"	TEXT NOT NULL,
	"updated_at"	TEXT DEFAULT NULL,
	"scheduled_at"	TEXT DEFAULT NULL,
	PRIMARY KEY("id")
);
DROP INDEX IF EXISTS "ix_events_scheduled";
CREATE INDEX "ix_events_scheduled" ON "events" ("scheduled_at"	ASC);
CREATE TABLE IF NOT EXISTS "weatherforecasts" (
	"id" INTEGER PRIMARY KEY,
	"date" TEXT NOT NULL,
	"json_obj" TEXT,
	"created_at" TEXT NOT NULL,
	"updated_at" TEXT
);
DROP INDEX IF EXISTS "ix_weatherforecasts_date";
CREATE INDEX "ix_weatherforecasts_date" ON "weatherforecasts" ("date" DESC);
COMMIT;
